    <script>
      const config = {
        'ph': {},
        'my': {},
        'th': {},
        'br': {},
        'cn': {},
        'id': {},
        'vn': {},
        'jp': {},
        'sk': {},
        'mc': {},
        'sg': {},
        'tw': {},
        'mm': {},
        'hk': {},
        'au': {},
        'ua': {},
        'la': {},
        'kh': {},
      }
      function createTooltip(event, message) {
        // Create the tooltip element
        const tooltip = document.createElement('div');
        tooltip.classList.add('tooltip'); // Add a CSS class for styling (optional)
        const image = document.createElement('img')
        image.setAttribute('src', message)
        tooltip.appendChild(image)
        document.body.appendChild(tooltip);

        // Position the tooltip near the clicked path
        const body = document.body;
        const path = event.target; // Get the clicked path element from the event object
        const rect = path.getBoundingClientRect();
        const tooltipdimensions = tooltip.getBoundingClientRect()
        console.log(tooltipdimensions)
        tooltip.style.left = `${rect.left + window.pageXOffset}px`;
        tooltip.style.top = `${rect.top + window.pageYOffset - 116}px`;

        // Remove the tooltip on click outside
        document.querySelector('svg').addEventListener('click', removeTooltip);

        function removeTooltip(evt) {
          if(!evt.target.classList.contains('dot')) {
            body.removeChild(tooltip);
          }
        }
      }
      const ids = [
        'id_urc', 'in_ceb', 'au_ceb',
        'vn_urc', 'vn_ceb', 'jp_ceb',
        'sk_ceb', 'th_urc', 'th_ceb',
        'my_urc', 'my_ceb', 'sg_urc',
        'sg_ceb', 'cn_urc', 'cn_ceb',
        'mc_ceb', 'hk_urc', 'hk_ceb',
        'tw_ceb', 'br_ceb', 'ua_ceb',
        'ph_rlc', 'ph_ceb', 'ph_jgsoc',
        'ph_jgs', 'ph_urc', 'mm_urc',
        'la_urc', 'kh_urc'
      ]
      document.querySelectorAll('.dot').forEach(el => {
        el.addEventListener('click', evt => {
          let message = 'my_tooltip.png'
          if(el.id.startsWith('mal')) {
            message = 'my_tooltip.png'
          }
          createTooltip(evt, message)
        })
      })
    </script>
